SELECT 
  DISTINCT DFLT_WHSE_ITEM_IND, WH_ITEM_ID_LGTH
FROM 
  WMFACOPT_STG 
WHERE 
  US_SERVICE_DIV        =   ${record:value('/header/Subscriber-ID Type')}
  AND US_DST_CNTR       =   ${record:value('/data/ERPO-DISTRIBUTION-CENTER')} 
  AND DATA_EXTRACT_SW   =   'Y' 
;

